import axios from "axios";

// const url = window.location.toString().split('/')[2]; // 런박스 인스턴스 주소

const api = axios.create({
  // baseURL: `https://${url}/proxy/8090/api/`, // 8080 포트는 VSCode가 사용 중
  baseURL: `http://localhost:3000/api/`,
  withCredentials: true,
});

export default api;
